bullets.css:
.uranus .sr7-bullet{
  border-radius: 50%;
  box-shadow: 0 0 0 2px ##color##;
  -webkit-transition: box-shadow 0.3s ease;
  transition: box-shadow 0.3s ease;
  background:transparent;
  width:##size##px;
  height:##size##px;
}
.uranus .sr7-bullet.selected,
.uranus .sr7-bullet.sr7-touchhover {
  box-shadow: 0 0 0 2px ##color-hover##;
  border:none;
  border-radius: 50%;
  background:transparent;
}

.uranus .sr7-bullet-inner {
  -webkit-transition: background-color 0.3s ease, -webkit-transform 0.3s ease;
  transition: background-color 0.3s ease, transform 0.3s ease;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  outline: none;
  border-radius: 50%;
  background-color: ##color##;
  background-color: ##color-inner##;
  text-indent: -999em;
  cursor: pointer;
  position: absolute;
}

.uranus .sr7-bullet.selected .sr7-bullet-inner,
.uranus .sr7-bullet.sr7-touchhover .sr7-bullet-inner{
 transform: scale(0.4);
 -webkit-transform: scale(0.4);
 background-color:##color-hover##;
}
